/*
The following script define a method
that increments an integer by 1 
and registers it as a UDF with 
the SparkSession, which can be accessed
using the variable named "spark":
def inc(i: Integer): Integer = {
  i + 1
}
spark.udf.register ("inc", inc _)

*/

records = sdc.records
fullrecord = null

if (records.size() > 0) {
  firstkey = records[0].attributes['first_field']
}

for (record in records) {
    try {
        if (record.value.containsKey(firstkey) && record.value[firstkey]) {
          fullrecord = record
        } else {
          fullrecord.value.each { key, val ->
            if (!record.value[key]?.trim()) {              
              record.value[key] = fullrecord.value[key]
            }
          }
        }

        // Write a record to the processor output
        sdc.output.write(record)
    } catch (e) {
        // Write a record to the error pipeline
        sdc.log.error(e.toString(), e)
        sdc.error.write(record, e.toString())
    }
}
